import React from 'react' 
import "../index.css"
import logo from '../images/logo.svg'

function Header() { 
  return (
    <header className="header root__header">
      <img
        className="header__logo"
        src={logo}
        alt="логотип Mesto"
      />
    </header>
  )
}

export default Header
